window.bookSummaryJSON = "<p>A young woman is murdered in Middle Falls, Oregon in 1952. The police never make an arrest, but the town convicts Ned Summers of the crime anyway. He banishes himself to a small house in the woods where he lives alone for the rest of his life. </p> <p>When he dies, he opens his eyes back in 1952, just a few days before the murder occurred. </p> <p>Can Ned Summers stop the murder and save his friend? </p> <p><i>Includes a special bonus note read by the author.</i></p>"; 
